import './App.css';
import SubmitForm from './components/SubmitForm';
import FirstCard from './components/Card';

function App() {
  return (
    <div className="App">
      <header className="App-header">
         <SubmitForm/>
      </header>
     <FirstCard/>
    </div>
  );
}

export default App;
